import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    constructor() {
        super();
        this.one = null;
        this.two = null;
        this.three = null;
        this.four = null;
    }

    createTable() {
        setInterval(() => {
            this.one = this.getRandomCity();
            this.two = this.getRandomCity();
            this.three = this.getRandomCity();
            this.four = this.getRandomCity();

            var list = [];
            list.push(<li key={0}> <City src={this.one.image} name={this.one.name} /> </li>);
            list.push(<li key={1}> <City src={this.two.image} name={this.two.name} /> </li>);
            list.push(<li key={2}> <City src={this.three.image} name={this.three.name} /> </li>);
            list.push(<li key={3}> <City src={this.four.image} name={this.four.name} /> </li>);

            return list;
        }, 1000);
    }

    getRandomCity() {
        var current = data[Math.floor(Math.random() * data.length)];
        if(!current.used) {
            current.used = true;
            return current;
        } else {
            current = data[Math.floor(Math.random() * data.length)];
            current.used = true;
            return current;
        }
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
                <button> <i onClick={this.createTable} className="back fa fa-arrow-left"></i> </button>
                <button> <i onClick={this.createTable} className="forward fa fa-arrow-right"></i> </button>
            </div>
        );
    }
}

export default SecondContent;
